import axios from "axios";
import {OnlineRoot, RootPath} from "./Config";

const Put = (path, root, data) => {
    const promise = new Promise((resolve, reject) => {
        axios.put(`${root ? OnlineRoot : RootPath}/${path}`, data)
            .then(response => {
                resolve(response);
            }, (err) => {
                reject(err);
            })
    })
}

export default Put;
